import React from "react";
import TodoItem from "./TodoItem";

import styled from "styled-components";

const TodoList = () => {
  return (
    <TodoListContainer>
      <TodoItem>Todo Item 0</TodoItem>
      <TodoItem>Todo Item 1</TodoItem>
      <TodoItem>Todo Item 2</TodoItem>
      <TodoItem>Todo Item 3</TodoItem>
      <TodoItem>Todo Item 4</TodoItem>
      <TodoItem>Todo Item 5</TodoItem>
    </TodoListContainer>
  );
};

const TodoListContainer = styled.ul((props) => {
  return {};
});

export default TodoList;
